/*! htmx loader - replace with vendored htmx.min.js for production. */
(function(){
  var s=document.createElement("script");
  s.src="https://cdn.jsdelivr.net/npm/htmx.org@2.0.8/dist/htmx.min.js";
  s.defer=true;
  s.onload=function(){
    if (window.htmx && window.htmx.process && document.body) {
      window.htmx.process(document.body);
    }
  };
  document.head.appendChild(s);
})();
